import React, { Fragment } from 'react'

const Navbar = () => {
    return(
    <Fragment>
        <nav>
            <img src='../data/fenrir.png' alt='logotipo fenrir'/>
            <li>Sobre mi</li>
            <li>Proyectos</li>
            <li>Contacto</li>
        </nav>
    </Fragment>
    );
}

export default Navbar;
